import React from 'react'
import 'semantic-ui/dist/semantic.min.css';
import './Managermain2.css'
import Managerheader1 from '../Managerpg1/Managerheader1'
import ManagerNav from "../Managerpg1/ManagerNav";
import ManagerFooter from "../Managerpg1/ManagerFooter";
import {BrowserRouter,Route,Link,Redirect} from "react-router-dom";
import Managermain3 from "../Managerpg3/Managermain3"



class Managermain2 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {


        }
    }


    setRedirect=() =>
    {
        this.setState({
            redirect:true
        })
        //window.location.reload();
    }

    renderRedirect =() =>{
        if(this.state.redirect)
        {
            return <Redirect to='/august'/>
        }

    }
    render() {

        return (


            <div>
                <Managerheader1/>
                <ManagerNav/>

                <br/>
                <br/>
                <br/>
                <h1 style={{color:"black"}}  className="ui" >Your Employee is 'NAME' </h1>
                <br/>
                <br/>



<div className="dropdown">
     <select value="Select year" className="ui" >

                        <option style={{color:"black"}} className="item">2017</option>
                        <option style={{color:"black"}} className="item">2018</option>
                            <option style={{color:"black"}} className="item">2019</option>
                            <option style={{color:"black"}} className="item">2020</option>
                        </select>
</div>



<br/>
<BrowserRouter>
    <nav>
        {this.renderRedirect()}
          <div className="calender">

                <button style={{margin:"30px"}} className="buttonGrey">JAN</button>
                <button style={{margin:"30px"}} className="buttonGrey">FEB</button>
                <button style={{margin:"30px"}} className="buttonGrey">MAR</button>
                <button style={{margin:"30px"}} className="buttonGrey">APR</button>
                <button style={{margin:"30px"}} className="buttonGrey">MAY</button>
                <button style={{margin:"30px"}} className="buttonGrey">JUN</button> <br/>
                <button style={{margin:"30px"}} className="buttonGrey">JUL</button>


              <button onClick={this.setRedirect()} className="buttonGreen" >AUG  </button>



                <button style={{margin:"30px"}} className="buttonRed">SEPT</button>
                <button style={{margin:"30px"}} className="buttonRed">OCT</button>
                <button style={{margin:"30px"}} className="buttonRed">NOV</button>
                <button style={{margin:"30px"}} className="buttonRed">DEC</button>

                <br/>
                <br/>




            </div>
    </nav>
</BrowserRouter>
<ManagerFooter/>
        </div>
        )
    }
}

        export default Managermain2
